			var previousHoverPoint = null;
			function plotGraph(graphName, stacked, showPoints, xmin, xmax, ymin, ymax) {
				//If no min or max specified, then render as normal
				if(xmin == undefined || xmax == undefined || ymin == undefined || ymax == undefined) {
					$.plot($("#" + graphName), data[graphName], {
						series: {
							stack: stacked,
							lines: { show: true, fill: stacked},
							points: {show:showPoints}
						},
						selection: { mode: "xy" }
					});
				}
				else {
					$.plot($("#" + graphName), data[graphName], {
						series: {
							stack: stacked,
							lines: { show: true, fill: stacked},
							points: {show:showPoints}
						},
						xaxis: { min: xmin, max: xmax },
						yaxis: { min: ymin, max: ymax },
						selection: { mode: "xy" }
					});
				}
				//Add the selection handler to the chart
				$("#" + graphName).unbind("plotselected");
				$("#" + graphName).bind("plotselected", getStackedSelectionHandler(graphName, stacked, showPoints));
				//Add the unselection handler to the chart
				$("#" + graphName).unbind("plotunselected");
				$("#" + graphName).bind("plotunselected", getStackedUnselectHandler(graphName, stacked, showPoints));
			}
			function getStackedUnselectHandler(graphName, stacked, showPoints) {
				var _graphName = graphName;
				var _stacked = stacked;
				var _showPoints = showPoints;				
				return function() {
					plotGraph(_graphName, _stacked, _showPoints);
				};
			}
			function getStackedSelectionHandler(graphName, stacked, showPoints) {
				var _graphName = graphName;
				var _stacked = stacked;
				var _showPoints = showPoints;				
				return function (event, ranges) {
					plotGraph(_graphName, _stacked, _showPoints, ranges.xaxis.from, ranges.xaxis.to, ranges.yaxis.from, ranges.yaxis.to);
				};
			}
			
